import { NavLink, Outlet } from "react-router-dom";

const RootLayout = () => {
    return (
       <>
          <nav className="bg-gray-200 rounded-md p-3 flex justify-between divide-x">
             <div className="text-center flex-1">
                <NavLink to="/" className="">
                   الشراء
                </NavLink>
             </div>
             <div className="text-center flex-1">
                <NavLink to="sales" className="">
                   المبيعات
                </NavLink>
             </div>
          </nav>
          <main>
             <Outlet />
          </main>
       </>
    );
}

export default RootLayout;
